import './App.css';
import {Container} from 'react-bootstrap';
import Footer from './components/footer';
import Header from './components/Header';
import Navbaramazon from './components/Navbaramazon';
import applogo from './assets/applogo.jpg';

function App() {
  return (
    <>
    <Navbaramazon/>
    <Header/>
    <main>
    <Container>
      <h1>Ecommerce App</h1>
      <img src={applogo}/>
    </Container>
    </main>
    <Footer/>
    </>
  );
}

export default App;
